	add("abecedarian", "{\"term\":\"abecedarian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027abecedarius\u0027 (from the first four letters of the Latin alphabet + \u0027-arius\u0027 . Equivalent to {{suffix|abecedary|an|lang\u003den}}. Compare \u0027abecedary\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who is learning the alphabet. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An elementary student, a novice; one in the early steps of learning. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"II.28\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A man may alwaies continue his studie, but not schooling. O fond-foolish for an old man to be ever an \u0027\u0027\u0027Abcedarian\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Someone engaged in teaching the alphabet; an elementary teacher; one that teaches the methods and principles of learning.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt; \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A work which uses words or lines in alphabetical order\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, in \u0027Mediaevalia\u0027 (published by the Center for Medieval and Early Renaissance Studies of the State University of New York at Binghamton), vol.19, p.133\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"This formal organization is most likely to create obscurity in such elaborate and artificial forms as: palindromes (words, phrases, or verses which read the same backward or forward), abecedarians (poems in which the initial letters of lines or stanzas are arranged to\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, \u0027A Descriptive Catalogue of the Music Collection of the National Library\u0027 (ISBN 0754651681), p.590\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Abecedarian verses are chanted stichoi/stichera verses in which the first letter of each verse follows an alphabetical order.The Amomos, an \u0027\u0027abecedarian\u0027\u0027, is the longest psalm in the Psalter\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Erich J. Goller, \u0027Groovy\u0027, p.165\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An \u0027\u0027Abecedarian\u0027\u0027 is any poem constrained by alphabetical order\", \"priority\":12}]}, \"synonyms\":{}}");

	add("abecedarian", "{\"term\":\"abecedarian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|abecedary|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a 16th-century Anabaptist sect, follower of the Zwickau prophets (and specially of Thomas Storch), who believed that any kind of knowledge (even basic reading and writing) would keep one from reaching obtaining salvation.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abecedarium", "{\"term\":\"abecedarium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|la|abecedārium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A book used to teach the alphabet; alphabet book; primer.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An inscription consisting of the letters of an alphabet, almost always listed in order\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abecedarius", "{\"term\":\"abecedarius\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"{{borrowing|NL.|abecedārius|lang\u003den}}, from\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An acrostic poem in which the lines begin with the letters of the alphabet in sequence.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("abecedary", "{\"term\":\"abecedary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027abecedary\u0027 from \u0027abecedarium\u0027 (alphabet, primer) from \u0027abecedarius\u0027 (lang\u003dla) formed from the first four letters of the Latin alphabet + \u0027-arius\u0027 () The sense \u0026quot;primer, abecearium\u0026quot; is from \u0027abecedarium\u0027 (alphabet, primer) \u0026lt;ref name\u003dSOED\u0026gt;{{R:SOED5|page\u003d3}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The alphabet, written out in a teaching book, or carved on a wall; a primer; abecedarium. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One that teaches or learns the alphabet or the fundamentals of any subject; abecedarian. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abednego", "{\"term\":\"abednego\", \"etymology\":{\"influencers\":[], \"languages\":[\"akkadian\", \"English\"], \"text\":\"From an Akkadian lt;!--?--\u0026gt; name meaning either \u0026quot;servant of Nabu\u0026quot; or \u0026quot;servant of Nergal\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the captives in the Bible that came out of the fiery furnace unharmed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And these three men, Shadrach, Meshach, and \u0027\u0027Abednego\u0027\u0027, fell down bound into the midst of the burning fiery furnace\", \"priority\":2}]}, \"synonyms\":{}}");

	add("abele", "{\"term\":\"abele\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"Latin\", \"Dutch\", \"jèrriais\"], \"text\":\"From Dutch {{m|nl|abeel}}, from Middle dutch (ca. 1050-1350) from Jèrriais {{m|nrf|abiel}}, from a diminutive of Latin {{m|la|albus||white}}.Image:Czajecice tree 20060812 1401.jpg|thumb|Abele; White poplar\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The white poplar (\u0027Populus alba\u0027). \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Mrs. Brownin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Six \u0027\u0027abeles\u0027\u0027 i\u0027 the churchyard grow\", \"priority\":3}]}, \"synonyms\":{}}");

