	add("abelia", "{\"term\":\"abelia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the genus name \u0027lang\u003dmul\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the various honeysuckles of the genus \u0027Abelia\u0027. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

