	add("abelmosk", "{\"term\":\"abelmosk\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\"], \"text\":\"From \u0027abelmoschus\u0027 from Arabic \u0027أَبُو المِسْك\u0027 (father of musk) or \u0027حَبّ المِسْك\u0027 (grain of musk) from \u0027حَبّ\u0027 (grain) + \u0027مِسْك\u0027 from Persian \u0027مشک\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An evergreen shrub, \u0027Abelmoschus moschatus\u0027 of the East and West Indies and Northern Africa, whose musky seeds are used in perfumery and to flavor coffee; - the musk mallow\", \"priority\":1}]}, \"synonyms\":{}}");

