	add("abenaki", "{\"term\":\"abenaki\", \"etymology\":{\"influencers\":[], \"languages\":[\"eastern abnaki\", \"western abnaki\", \"algonquin\", \"English\", \"French\", \"montagnais\"], \"text\":\"From French \u0027abénaqui\u0027 either from Montagnais \u0027ouabanākionek\u0027 (people of the eastern country) lt;ref name\u003dSOED\u0026gt;{{reference-book|editor\u003dLesley Brown|title\u003dThe Shorter Oxford English Dictionary|origyear\u003d1933|edition\u003d5th|year\u003d2003|publisher\u003dOxford University Press|location\u003dOxford, UK|isbn\u003d978-0-19-860575-7|lccn\u003d |ol\u003d |pages\u003d3}}\u0026lt;/ref\u0026gt; or from the Western Western abnaki autonym \u0027wôbanaki\u0027 or an Eastern Abenaki/Eastern abnaki cognate of the same,\u0026lt;ref\u0026gt;{{R:Dictionary.com}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Etymonline}}\u0026lt;/ref\u0026gt; from Algonquin Ultimately a compound word meaning \u0026quot;people of the east\u0026quot; or \u0026quot;people of the dawn-land\u0026quot;, from Proto-algonquian {{m|alg-pro|*wa·panki||dawn}} + {{m|alg-pro|*axkyi||land}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Algonquian First People from northeastern North America, mainly Maine and Quebec. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Abenaki\u0027\u0027 have unique customs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A complex of Eastern Algonquian lects, originally spoken in what is now Maine, and Quebec, divided into Western Abenaki and Eastern Abenaki (Penobscot). \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Western Abenaki language\", \"priority\":4}]}, \"synonyms\":{}}");

