	add("abenomics", "{\"term\":\"abenomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The economic policies advocated by Japanese Prime Minister\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Koichi Hamada, \u0027[http://www.project-syndicate.org/commentary/on-the-risks-of-japan-s-impending-consumption-tax-increase-by-koichi-hamada Japan’s Tax-Hike Test\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If Japan’s government can overcome a demand setback after the tax increase takes effect – leaving the economy functioning smoothly and initiating a recovery in government revenue – Abe will be able to declare \u0027\u0027Abenomics\u0027\u0027 an unequivocal success\", \"priority\":3}]}, \"synonyms\":{}}");

	add("aberdeen", "{\"term\":\"aberdeen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Scottish Gaelic\", \"pictish\"], \"text\":\"The first element is either Scottish gaelic \u0027aber\u0027 (lang\u003dgd) or Pictish \u0027\u0027 (aber) The second element is \u0027don\u0027 (river in scotland) (the site of {{w|Old Aberdeen}}). Written \u0027aberdon\u0027 circa 1187 and \u0027aberden\u0027 circa 1214.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A port city in Scotland, on the North Sea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A county in northeastern Scotland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Florid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A village in the State of Georgi\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A city in Idah\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Porter County, Indian\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A city in eastern Maryland, home of the Aberdeen Proving Grounds\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A city in Mississipp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A town in New South Wale\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A town in North Carolin\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A community in Nova Scoti\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A village in Ohi\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A community in Ontari\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A town in Saskatchewa\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A town in Eastern Cape, South Afric\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A city in northeastern South Dakota\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A city in Washington\", \"priority\":17}]}, \"synonyms\":{}}");

	add("aberdevine", "{\"term\":\"aberdevine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Eurasian siskin or , \u0027Spinus spinus\u0027, a small green and yellow finch related to the goldfinch. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("aberrance", "{\"term\":\"aberrance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027aberr\u0027 (to stray) from Latin \u0027aberrare\u0027 + \u0027-ance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"State of being aberrant; a wandering from the right way; deviation from truth, rectitude. \u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

