	add("aberration", "{\"term\":\"aberration\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"A {{learned borrowing|la|aberrātiō|gloss\u003drelief, diversion|lang\u003den|nocap\u003d1}}, first attested in 1594 \u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/aberration Aberration at Dictionary.com]\u0026lt;/ref\u0026gt;, from {{m|la|aberrō||wander away, go astray}}, from \u0027ab\u0027 (away) + {{m|la|errō||wander}}\u0026lt;ref\u0026gt;{{R:CDOE|page\u003d2}}\u0026lt;/ref\u0026gt;. Compare French \u0027aberration\u0027 See also \u0027aberrate\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of wandering; deviation from truth, moral rectitude; abnormal; divergence from the straight, correct, proper, normal, or from the natural state. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027aberration\u0027\u0027 of youth\u0027, \u0027\u0027\u0027aberrations\u0027\u0027 from theory\u0027, \u0027\u0027\u0027aberration\u0027\u0027 of character\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The convergence to different foci, by a lens or mirror, of rays of light emanating from one and the same point, or the deviation of such rays from a single focus; a defect in a focusing mechanism that prevents the intended focal point. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small periodical change of position in the stars and other heavenly bodies, due to the combined effect of the motion of light and the motion of the observer. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A partial alienation of reason. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Lingard\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Occasional \u0027\u0027aberrations\u0027\u0027 of intellect\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I. Taylor\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Whims, which at first are the \u0027\u0027aberrations\u0027\u0027 of a single brain, pass with heat into epidemic form\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A mental disorder, especially one of a minor or temporary character. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Atypical development or structure; deviation from the normal type; an aberrant organ. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A deviation of a tissue, organ or mental functions from what is considered to be within the normal range\", \"priority\":12}]}, \"synonyms\":{}}");

