	add("abeyance", "{\"term\":\"abeyance\", \"etymology\":{\"influencers\":[{},{},{},{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"First attested in 1528. From Anglo-norman \u0027abeiance\u0027 (legal expectation) from Old french (842-ca. 1400) \u0027abeance\u0027 (desire) from \u0027abeer\u0027 \u0027abaer\u0027 \u0027abair\u0027 (to desire) from \u0027a\u0027 (to) + \u0027baer\u0027 \u0026lt;ref\u0026gt;{{R:American Heritage 1971|page\u003d3}}\u0026lt;/ref\u0026gt; \u0027bair\u0027 (yawn) from \u0027batō\u0027 (to yawn) lt;ref\u0026gt;{{R:MW3 1976|page\u003d3}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:CDOE|page\u003d2}}\u0026lt;/ref\u0026gt;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Expectancy; condition of ownership of real property being undetermined; lapse in succession of ownership of estate, or title. \u0026lt;ref name\u003dSOED\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The proceeds of the estate shall be held in \u0027\u0027abeyance\u0027\u0027 in an escrow account until the minor reaches age twenty-one\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When there is no person in existence in whom an inheritance (or a dignity) can vest, it is said to be in \u0027\u0027abeyance\u0027\u0027.\u0027 -Blackston\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Suspension; temporary suppression; dormant condition. \u0026lt;ref name\u003dSOED/\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027A Short History of Nearly Everything\u0027, BCA 2003, page 376\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Without a plausible explanation for what might have provoked an ice age, the whole theory fell into \u0027\u0027abeyance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Expectancy of a title, its right in existence but its exercise suspended\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The broad pennant of a commodore first class has been in \u0027\u0027abeyance\u0027\u0027 since 1958, together with the rank\", \"priority\":8}]}, \"synonyms\":{}}");

